import React from "react"
import axios from 'axios'

const Home = () => {


    React.useEffect(() => {
        axios.get('https://api.openweathermap.org/data/2.5/weather?q=%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0&appid=9564702c3543cd18a286664bcd09dcac').then(resp => {
            console.log(resp.data)
        })
    }, [])

    return (
        <div>
            Hello
        </div>
    )
}

export default Home
